var mapLoaded = false;
var map;
var directions;

function loadMap(origin, destination) {
  if (!mapLoaded) {
    map = new mapboxgl.Map({
      container: 'map',
      style: 'mapbox://styles/mapbox/streets-v11',
      center: [78.37, 17.47],
      zoom: 13
    });
    directions = new MapboxDirections({
      accessToken: mapboxgl.accessToken
    });
    navigation = new mapboxgl.NavigationControl({
      accessToken: mapboxgl.accessToken
    });
    map.addControl(directions, 'top-left');
    map.addControl(navigation);
    map.on('load', function () {
      mapLoaded = true;
      directions.setOrigin(origin);
      directions.setDestination(destination);
    });
  } else {
    directions.setOrigin(origin);
    directions.setDestination(destination);
  }
}

document.getElementById('checkout-submit').addEventListener('click', function (e) {
  e.preventDefault();
  var checkoutName = document.getElementById('checkout-name').value;
  var checkoutAddress = document.getElementById('checkout-address').value;

  if (checkoutName != '' && checkoutAddress != '') {
    var pickupOrDeliveryBtns = document.getElementsByName('pickup-or-delivery');
    var pickupOrDelivery;

    for (var i = 0; i < pickupOrDeliveryBtns.length; i++) {
      if (pickupOrDeliveryBtns[i].checked) {
        pickupOrDelivery = pickupOrDeliveryBtns[i].value;
      }
    }

    if (pickupOrDelivery == '1') loadMap(checkoutAddress, [78.37072665440921, 17.45143670338925]);else if (pickupOrDelivery == '2') loadMap([78.37072665440921, 17.45143670338925], checkoutAddress);
    localStorage.setItem('cartNumbers', 0);
    localStorage.setItem('itemsInCart', '{}');
  } else {
    alert('Please fill out all the fields');
  }
});
